import React, { useState } from 'react';
import { connect } from "react-redux";
import {setLogin} from '../../store/actions/home'
const Home = (props) => {
   
    return (<div>
        <button onClick={()=>props.setLogin(true)}>Open Modal</button>
    </div>);
}

export default connect(null,{setLogin})( Home);
